                    const coords2 = [truckPathData[i][0], truckPathData[i][1]];
                    const dist = Cesium.Cartesian3.distance(
                        Cesium.Cartesian3.fromDegrees(coords1[0], coords1[1]),
                        Cesium.Cartesian3.fromDegrees(coords2[0], coords2[1])
                    );
                    cumulativeDistances.push(cumulativeDistances[i-1] + dist);
                }
                const totalPathLength = cumulativeDistances[cumulativeDistances.length - 1];

                for (let i = 0; i < truckPathData.length; i++) {
                    const lon = truckPathData[i][0];
                    const lat = truckPathData[i][1];
                    const alt = truckPathData[i][2]; // Relatif terhadap baseAnchorAlt + offset + extrusion_height

                    const position = Cesium.Cartesian3.fromDegrees(lon, lat, baseAnchorAlt + alt); // Ketinggian awal truk
                    
                    const timeOffset = totalPathLength > 0 ? (cumulativeDistances[i] / totalPathLength) * totalDuration : 0;
                    const time = Cesium.JulianDate.addSeconds(startTime, timeOffset, new Cesium.JulianDate());
                    initialTruckPositionProperty.addSample(time, position);
                }

                viewer.clock.endTime = Cesium.JulianDate.addSeconds(startTime, totalDuration, new Cesium.JulianDate());
                viewer.clock.currentTime = startTime;
                viewer.clock.clockRange = Cesium.ClockRange.LOOP_STOP; 

                truckEntity = viewer.entities.add({
                    availability: new Cesium.TimeIntervalCollection([new Cesium.TimeInterval({
                        start: startTime,
                        stop: viewer.clock.endTime
                    })]),
                    position: initialTruckPositionProperty, // Gunakan properti posisi awal
                    model: {
                        uri: truckModelUri,
                        minimumPixelSize: 64, 
                        maximumScale: 500, 
                        heightReference: Cesium.HeightReference.NONE // Truk juga menggunakan ketinggian absolut
                    },
                    orientation: new Cesium.VelocityOrientationProperty(initialTruckPositionProperty) 
                });

                // Speed slider
                speedSlider.addEventListener('input', function() {
                    viewer.clock.multiplier = parseFloat(this.value);
                    speedValueSpan.textContent = `${viewer.clock.multiplier.toFixed(1)} x`;
                });

                // Play/Pause button
                playPauseButton.addEventListener('click', function() {
                    viewer.clock.shouldAnimate = !viewer.clock.shouldAnimate;
                    this.textContent = viewer.clock.shouldAnimate ? 'Pause' : 'Play';
                });

                // Reset button
                resetButton.addEventListener('click', function() {
                    viewer.clock.currentTime = startTime;
                    viewer.clock.shouldAnimate = true;
                    playPauseButton.textContent = 'Pause';
                });

                viewer.zoomTo(viewer.entities);

            } else {
                console.warn("Jalur truk atau model truk tidak tersedia, tidak akan menampilkan truk.");
            }

        } catch (error) {
            console.error('Gagal memuat model atau mengatur kontrol:', error);
        }
    </script>
</body>
</html>
